svg.script:
(function () {
const eyes = {
left: {
// "cx":1548.9305419921875,"cy":3043.422119140625,"rx":450.506591796875,"ry":810.911865234375,"ox":-140,"oy":-50
el: document.querySelector('#Left\\ eye #Eye\\ center'),
cx: 1548.9305419921875,
cy: 3043.422119140625,
rx: 465.5234375,
ry: 810.911865234375,
ox: -120,
oy: -50
},
right: {
el: document.querySelector('#Right\\ eye #Eye\\ center'),
cx: 3566.198974609375,
cy: 2993.365966796875,
rx: 465.5234375,
ry: 810.911865234375,
ox: 120,
oy: -50
}
};

const svg = document.querySelector('svg');
window.xeyes = eyes; // expose main config

// ------------------------
// X-eyes follow mouse
// ------------------------
svg.addEventListener('mousemove', function (evt) {
const pt = svg.createSVGPoint();
pt.x = evt.clientX;
pt.y = evt.clientY;
const cursor = pt.matrixTransform(svg.getScreenCTM().inverse());

for (const side in eyes) {
const e = eyes[side];
const dx = cursor.x - e.cx;
const dy = cursor.y - e.cy;

let nx = dx / e.rx;
let ny = dy / e.ry;
let tx = dx,
ty = dy;

if (nx * nx + ny * ny > 1) {
const k = 1 / Math.sqrt(nx * nx + ny * ny);
tx = dx * k;
ty = dy * k;
}

tx += e.ox;
ty += e.oy;

e.el.setAttribute('transform', 'translate(' + tx + ',' + ty + ')');
}
});

// ------------------------
// Calibration helper
// ------------------------
window.xeyes.calcEllipse = function (side) {
const e = eyes[side];
if (!e) {
console.warn('Unknown eye name:', side);
return;
}
console.log(
`Click 4 points around the ${side} sclera bounds (top/right/bottom/left)...`
);

let clicks = [];
const handler = function (evt) {
const pt = svg.createSVGPoint();
pt.x = evt.clientX;
pt.y = evt.clientY;
const p = pt.matrixTransform(svg.getScreenCTM().inverse());
clicks.push([p.x, p.y]);

console.log(`Click registered (${clicks.length}/4):`, p);

if (clicks.length === 4) {
svg.removeEventListener('click', handler);

const xs = clicks.map((c) => c[0]);
const ys = clicks.map((c) => c[1]);

const minX = Math.min.apply(null, xs);
const maxX = Math.max.apply(null, xs);
const minY = Math.min.apply(null, ys);
const maxY = Math.max.apply(null, ys);

const cx = (minX + maxX) / 2;
const cy = (minY + maxY) / 2;
const rx = (maxX - minX) / 2;
const ry = (maxY - minY) / 2;

// Update live config
e.cx = cx;
e.cy = cy;
e.rx = rx;
e.ry = ry;

console.log(
`%cCalibration complete for ${side}!`,
'color: lime; font-weight:bold'
);
console.log(
`cx=${cx.toFixed(1)}, cy=${cy.toFixed(1)}, rx=${rx.toFixed(
1
)}, ry=${ry.toFixed(1)}`
);
console.log(
'Paste these into config if you want them as defaults.'
);
}
};
svg.addEventListener('click', handler);
};
})();
